import classes from "./Block11.module.css";
import React from "react";
import Item from '../Block11/Items/Item'



let Block11 = (props) => {
    let item2 = props.re[0].item2;
    let item3 = props.re[0].item3;
    let item4 = props.re[0].item4;
    let item5 = props.re[0].item5;
    let item6 = props.re[0].item6;
    let item7 = props.re[0].item7;
    let item8 = props.re[0].item8;

   console.log(props.re[0].item1.icon);
     return(
        <div className={classes.block}>
            <h1>our services</h1>
            <div className={classes.blockFlex}>
                <Item icon={props.re[0].item1.icon} title={props.re[0].item1.title} text1={props.re[0].item1.text1} link={props.re[0].item1.link} text2={props.re[0].item1.text2}/>
                <Item icon={item2.icon} title={item2.title} text={item2.text} />
                <Item icon={item3.icon} title={item3.title} text={item3.text} />
                <Item icon={item4.icon} title={item4.title} text={item4.text} />
                <Item icon={item5.icon} title={item5.title} text={item5.text} />
                <Item icon={item6.icon} title={item6.title} text={item6.text} />
                <Item icon={item7.icon} title={item7.title} text={item7.text} />
                <Item icon={item8.icon} title={item8.title} text={item8.text} />
            </div>

        </div>
    );
};
export default Block11;
